import Header from "./Header";
import { useState } from "react";
import { useEffect } from "react";
import { useLocation } from "react-router-dom";
//Accessing passed route state

function ResultPage() {
  const location = useLocation();
  const [resultData, setResultData] = useState([]); 

  useEffect(() => {
    if (location.state?.responseData) {  // if not null
      setResultData(location.state.responseData); // set resultData to the data rendered from previous page
    }
  }, [location.state]); // Re-run if location.state changes



  return (
    <div>
      <Header />
      <h1 style={titleStyle}>Your Personalized Shopping List</h1> 
      <div style ={constentStyle}>
      <div className="resultTable">
        <table style={tableStyle}>
          <thead>
            <tr style={{ backgroundColor: "#f2f2f2" }}>
              <th>Items</th>
              <th>Stores</th>
              <th>Quantity</th>
              <th>Prices</th>
              <th>Total</th>
            </tr>
          </thead>
          <tbody>
            {resultData.map((item) => (
              <tr>
                <td>{item.Items}</td>
                <td>{item.Stores}</td>
                <td>{item.Quantity}</td>
                <td>{item.Prices}</td>
                <td>{item.Total}</td>
              </tr>
            ))}
            {/* if no {}, it will be considered as text instead of js code ; */}
          </tbody>
        </table>
      </div>
      <div style={feedbackStyle}>
          <h1 style={feedbackTitleStyle}>Not Satisfied With The Result? Any Feedback?</h1>
          <form onSubmit={handleFeedbackSubmit} style={formStyle}>
            <input
              type="text"
              value={feedbackInput}
              onChange={(e) => setFeedbackInput(e.target.value)}
              placeholder="Type down your customized request..."
              style={inputStyle}
            />
            <div style={buttonContainerStyle}>
              <button type="submit" style={submitButtonStyle} disabled={isLoading}>
                {isLoading ? "Processing..." : "Regenerate"}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default ResultPage;
const titleStyle = {
  borderWidth: "0px",
  position: "absolute",
  left: "400px",
  top: "100px",
  width: "556px",
